import "./index.css";
import Frontpage from "./Components/Frontpage";
import Accountpage from "./Components/Accountpage";

import { Routes, Route, Navigate } from "react-router-dom";
import { useSelector } from "react-redux";

//Assignment 2
function Protected(props) {
  return props.loggedIn ? props.children : <Navigate to={"/"} replace={true} />;
}

function IsLoggedIn(props) {
  return props.loggedIn ? <Navigate to="/" replace={true} /> : props.children;
}

function App() {

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Frontpage />} />

        <Route
          path="/member"element={<Accountpage/>}>
        </Route>

      </Routes>


    </div>
  );
}
//react state machine,view lib
//redux compend base ,state

export default App;
